export const fetchPosts = () => API.get('/posts')
export const createPost = (newPost) =>
  API.post('/posts', newPost)
  .then((res) => {
    console.log("api",res)
  })
  .catch((err) => {
    console.log(err)
  })

export const getResult = () => API.get('/result')

export const deletePost = (id) => API.delete(`/posts/${id}`)

